import React ,{useState} from 'react'
import "../../styles/QuestionCompOne.css"
import {Link} from 'react-router-dom'
const ScienceAndNature = () => {
	const questions = [
		{
			questionText: 'Along with Oxygen, which element is primarily responsible for the sky appearing blue?',
			answerOptions: [
				{ answerText: 'Helium', isCorrect: false },
				{ answerText: 'Nitrogen', isCorrect: true },
				{ answerText: ' Carbon', isCorrect: false },
				{ answerText: 'Hydrogen	', isCorrect: false },
			],
		},{
			questionText: 'What is the colour of unoxidized blood?',
			answerOptions: [
				{ answerText: 'Blue', isCorrect: false },
				{ answerText: ' Purple', isCorrect: false },
				{ answerText: 'Green	', isCorrect: false },
				{ answerText: 'Red', isCorrect: true },
			],
		},{
			questionText: 'The moons, Miranda, Ariel, Umbriel, Titania and Oberon orbit which planet?',
			answerOptions: [
				{ answerText: 'Uranus', isCorrect: false },
				{ answerText: 'Venus', isCorrect: true },
				{ answerText: ' Jupiter', isCorrect: false },
				{ answerText: 'Neptune	', isCorrect: false },
			],
		},{
			questionText: 'What mineral has the lowest number on the Mohs scale?',
			answerOptions: [
				{ answerText: 'Quartz', isCorrect: false },
				{ answerText: ' Diamond', isCorrect: false },
				{ answerText: 'Talc', isCorrect: true },
				{ answerText: 'Gypsum	', isCorrect: false },
			],
		},{
			questionText: 'How many degrees Fahrenheit is 100 degrees Celsius? ',
			answerOptions: [
				{ answerText: '212', isCorrect: true },
				{ answerText: '326', isCorrect: false },
				{ answerText: ' 100', isCorrect: false },
				{ answerText: '451	', isCorrect: false },
			],
		},{
			questionText: 'To the nearest minute, how long does it take for light to travel from the Sun to the Earth?',
			answerOptions: [
				{ answerText: '6 Minutes', isCorrect: false },
				{ answerText: ' 2 Minutes', isCorrect: false },
				{ answerText: '12 Minutes	', isCorrect: false },
				{ answerText: '8 Minutes', isCorrect: true },
			],
		},{
			questionText: 'All the following metal elements are liquids at or near room temperature EXCEPT:',
			answerOptions: [
				{ answerText: 'Gallium', isCorrect: false },
				{ answerText: ' Caesium', isCorrect: false },
				{ answerText: 'Beryllium', isCorrect: true },
				{ answerText: 'Mercury	', isCorrect: false },
			],
		},{
			questionText: 'How many officially recognized dwarf planets in the solar system are named after Polynesian deities?',
			answerOptions: [
				{ answerText: '0', isCorrect: false },
				{ answerText: '2', isCorrect: true },
				{ answerText: ' 1', isCorrect: false },
				{ answerText: '5	', isCorrect: false },
			],
		},{
			questionText: 'The medical condition osteoporosis affects which part of the body?',
			answerOptions: [
				{ answerText: 'Bones', isCorrect: true },
				{ answerText: 'Skin', isCorrect: false },
				{ answerText: ' Brain', isCorrect: false },
				{ answerText: 'Heart	', isCorrect: false },
			],
		},{
			questionText: 'Which part of the body does glaucoma affect?',
			answerOptions: [
				{ answerText: 'Throat', isCorrect: false },
				{ answerText: ' Stomach', isCorrect: false },
				{ answerText: 'Blood	', isCorrect: false },
				{ answerText: 'Eyes', isCorrect: true },
			],
		},{
			questionText: 'Which one of these scientists conducted the Gold Foil Experiment which concluded that atoms are mostly made of empty space?',
			answerOptions: [
				{ answerText: 'Joseph John Thomson', isCorrect: false },
				{ answerText: ' Archimedes', isCorrect: false },
				{ answerText: 'Ernest Rutherford', isCorrect: true },
				{ answerText: 'Niels Henrik David Bohr	', isCorrect: false },
			],
		},{
			questionText: 'What stage of development do the majority of eukaryotic cells remain in for most of their life?',
			answerOptions: [
				{ answerText: 'Prophase', isCorrect: false },
				{ answerText: 'Interphase', isCorrect: true },
				{ answerText: ' Stasis', isCorrect: false },
				{ answerText: 'Telophase	', isCorrect: false },
			],
		},{
			questionText: 'Deuterium is an isotope of which element?',
			answerOptions: [
				{ answerText: 'Hydrogen', isCorrect: true },
				{ answerText: 'Nitrogen', isCorrect: false },
				{ answerText: ' Helium', isCorrect: false },
				{ answerText: 'Neon	', isCorrect: false },
			],
		},{
			questionText: 'About how old is Earth?',
			answerOptions: [
				{ answerText: '3.5 Billion Years', isCorrect: false },
				{ answerText: ' 2.5 Billion Years', isCorrect: false },
				{ answerText: '4.5 Billion Years', isCorrect: true },
				{ answerText: '1.5 Billion Years	', isCorrect: false },
			],
		},{
			questionText: 'What is the unit of electrical capacitance?',
			answerOptions: [
				{ answerText: 'Gauss', isCorrect: false },
				{ answerText: ' Henry', isCorrect: false },
				{ answerText: 'Watt	', isCorrect: false },
				{ answerText: 'Farad', isCorrect: true },
			],
		},{
			questionText: 'What are human nails made of?',
			answerOptions: [
				{ answerText: 'Bone', isCorrect: false },
				{ answerText: 'Keratin', isCorrect: true },
				{ answerText: ' Chitin', isCorrect: false },
				{ answerText: 'Calcium	', isCorrect: false },
			],
		},{
			questionText: 'What do you study if you are studying entomology?',
			answerOptions: [
				{ answerText: 'Insects', isCorrect: true },
				{ answerText: 'Humans', isCorrect: false },
				{ answerText: ' the Brain', isCorrect: false },
				{ answerText: 'Fish	', isCorrect: false },
			],
		},{
			questionText: 'Which color cannot be produced in Roses, even through genetic alteration?',
			answerOptions: [
				{ answerText: 'Black', isCorrect: false },
				{ answerText: ' Orange', isCorrect: false },
				{ answerText: 'Brown	', isCorrect: false },
				{ answerText: 'Blue', isCorrect: true },
			],
		},{
			questionText: 'What is the study of the cells and tissues of plants and animals?',
			answerOptions: [
				{ answerText: 'Histology', isCorrect: true },
				{ answerText: 'Microbiology', isCorrect: false },
				{ answerText: ' Anatomy	', isCorrect: false },
				{ answerText: 'Biochemistry	', isCorrect: false },
			],
		},{
			questionText: 'When was the first mammal successfully cloned?',
			answerOptions: [
				{ answerText: '2009', isCorrect: false },
				{ answerText: ' 1999', isCorrect: false },
				{ answerText: '1996', isCorrect: true },
				{ answerText: '1985	', isCorrect: false },
			],
		},
        
		
		
	];
	const [currentQuestion, setCurrentQuestion] = useState(0);
	const [showScore, setShowScore] = useState(false);
	const [score, setScore] = useState(0);

	const handleAnswerOptionClick = (isCorrect) => {
		if (isCorrect) {
			setScore(score + 1);
		}

		const nextQuestion = currentQuestion + 1;
		if (nextQuestion < questions.length) {
			setCurrentQuestion(nextQuestion);
		} else {
			setShowScore(true);
		}
	};
	return (
		<div className='questions'>
		<div className='question-comp'>
			{showScore ? (
				<div className='score-section'>
                <p className='result '>Your Result</p>
                <p className='' >Your IQ is {score / 20*100}  </p>
                <p className=''>In this test You have answered {score} correct answers from  {questions.length} </p>
             <div className=''>
             <h3 className='mt-3 mb-4'  >Books Quiz</h3>
             <p className='mt-3 mb-3' >Play Popular Quizs online without instalation</p>
             <div className='return-links'>
             <Link to='/films' className='text-decoration-none' >Entertainment Films</Link>
             <button className='slide-btn'><Link to='/quiz-home' className='text-decoration-none' >Back To Quiz home</Link></button>
            </div>
            <div className='share'>
            <strong className='pb-2 pt-1'>Share Result</strong>
            <ul className='share-icons'>
            <li ><a href="https://whatsapp.com" target='_blank'><i className="fa-brands fa-whatsapp"></i></a> </li>
            <li ><a href="https://twitter.com" target='_blank'><i className="fa-brands fa-twitter"></i></a> </li>
            <li ><a href="https://facebook.com" target='_blank'><i className="fa-brands fa-facebook"></i></a> </li>
            <li ><a href="https://telegram.com" target='_blank'><i className="fa-brands fa-telegram"></i></a> </li>
            <li ><a href="https://pinterest.com" target='_blank'><i className="fa-brands fa-pinterest"></i></a> </li>
            
            </ul>
            </div>
             </div>
				</div>
			) : (
				<>
					<div className='question-section'>
						<div className='question-count'>
							<span>Question {currentQuestion + 1}</span>/{questions.length}
						</div>
						<div className='question-text'>{questions[currentQuestion].questionText}</div>
					</div>
					<div className='answer-section'>
						{questions[currentQuestion].answerOptions.map((answerOption) => (
							<button onClick={() => handleAnswerOptionClick(answerOption.isCorrect)}>{answerOption.answerText}</button>
						))}
					</div>
				</>
			)}
		</div>
		</div>
	);
}
export default ScienceAndNature
